					tokensAceptados.Add(StackDeEntrada.Pop());
					StackDeConsumo.Push(9);
					Simbolos += $" { _lookahead} ";
					Simbolos = Simbolos.Trim();
					StackDeLineasYColumnas.Pop(); break;

				case "void":
