		public void Estado155(string _lookahead)
		{
			switch (_lookahead)
			{
				case ".":
					//desplazamientoconsume .
					tokensAceptados.Add(StackDeEntrada.Pop());
					StackDeConsumo.Push(168);
					Simbolos += $" { _lookahead} ";
					Simbolos = Simbolos.Trim();
					StackDeLineasYColumnas.Pop(); break;

				default:
					Err(); break;
			}
		}
